sourcesContent:
require('dotenv').config();
import nodemailer from 'nodemailer';


let sendSimpleEmail = async (dataSend) => {

    let transporter = nodemailer.createTransport({
        service: 'gmail',
        auth: {
            user: process.env.EMAIL_APP,
            pass: process.env.EMAIL_APP_PASSWORD,
        }
    });

    let mailOptions = {
        from: '"Le Tat Tuan " <letattuan04052003@gmail.com>',
        to: dataSend.receiverEmail,
        subject: "Thng tin t lch khm bnh",
        html: getBodyHTMLEmail(dataSend),
    };

    transporter.sendMail(mailOptions, function (error, info) {
        if (error) {
            console.log(error);
        } else {
            console.log('Email sent: ' + info.response);
        }
    });
}

let getBodyHTMLEmail = (dataSend) => {
    let result = '';
    if (dataSend.language === 'en') {
        result = `
        <h3>Dear ${dataSend.patientName}!</h3>
        <p>You received this email because you booked an online medical appointment on booking.care</p>
        <p>Information to schedule an appointment: </p>
        <div><b>Time: ${dataSend.time}</b></div>
        <div><b>Doctor: ${dataSend.doctorName}</b></div>

        <p>
            If the above information is true, please click
            Click the link below to confirm and complete the procedure
            schedule a medical examination
        </p>
        <div>
            <a href=${dataSend.redirectLink} target="_blank">Click here!</a>
        </div>

        <div>Sincerely thank!</div>
        `
    }
    if (dataSend.language === 'vi') {
        result = `
        <h3>Xin cho ${dataSend.patientName}!</h3>
        <p>Bn nhn c email ny v  t lch khm bnh online trn booking.care</p>
        <p>Thng tin t lch khm bnh: </p>
        <div><b>Thi gian: ${dataSend.time}</b></div>
        <div><b>Bc s: ${dataSend.doctorName}</b></div>

        <p>
            Nu cc thng tin trn l ng s tht, vui lng click
            vo ng link bn di  xc nhn v hon tt th tc
            t lch khm bnh
        </p>
        <div>
            <a href=${dataSend.redirectLink} target="_blank">Click here!</a>
        </div>

        <div>Xin chn thnh cm n!</div>
        `
    }

    return result;
}

let sendAttachment = async (dataSend) => {
    let transporter = nodemailer.createTransport({
        service: 'gmail',
        auth: {
            user: process.env.EMAIL_APP,
            pass: process.env.EMAIL_APP_PASSWORD,
        }
    });

    let mailOptions = {
        from: '"Le Tat Tuan " <letattuan04052003@gmail.com>',
        to: dataSend.email,
        subject: "Kt qu khm bnh",
        attachments: [
            {   // encoded string as an attachment
                filename: `remedy-${dataSend.patientId}-${new Date().getTime()}.png`,
                content: dataSend.imgBase64.split('base64,')[1],
                encoding: 'base64'
            },
        ],
        html: getBodyHTMLEmailRemedy(dataSend),
    };

    transporter.sendMail(mailOptions, function (error, info) {
        if (error) {
            console.log(error);
        } else {
            console.log('Email sent: ' + info.response);
        }
    });
}

let getBodyHTMLEmailRemedy = (dataSend) => {
    let result = '';
    if (dataSend.language === 'vi') {
        result = `
        <h3>Xin cho ${dataSend.patientName}!</h3>
        <p>Bn nhn c email ny v   khm bnh thnh cng!</p>
        <p>Thng tin kt qu khm bnh(n thuc/ha n) c gi trong
        file nh km.</p>

        <div>Xin chn thnh cm n!</div>
        `
    }
    if (dataSend.language === 'en') {
        result = `
        <h3>Dear ${dataSend.patientName}!</h3>
        <p>You are receiving this email because your medical examination was successful!</p>
        <p>Medical examination result information (prescription/invoice) is sent in
        attached files.</p>

        <div>Sincerely thank!</div>
        `
    }

    return result;
}
module.exports = {
    sendSimpleEmail,
    sendAttachment
}

